// Faq.js

import React from 'react';

const Faq = () => {
  return (
    <div>
      <h1>Frequently Asked Questions (FAQs)</h1>
      <section>
        <h2>Question 1?</h2>
        <p>Answer to question 1.</p>
      </section>
      <section>
        <h2>Question 2?</h2>
        <p>Answer to question 2.</p>
      </section>
      {/* Add more sections for additional questions */}
    </div>
  );
};

export default Faq;
